const LOGO_URI = "data:image/png;base64,"
const CCM_LOGO_URI = "data:image/png;base64,"

const LOGOS = {
  CML: LOGO_URI,
  CCM: CCM_LOGO_URI,
}

const COLOURS = {
  "black": "#000000",
  "red": "#ff0000",
  "green": "#01622e",
  "blue": "#0000ff",
}

let logo_uri = ""
let change_timer = 0
let advanced_controls = false
let current_label = null
const b64 = `Q01MbGFiZWxzMjAyMCM=`

const get_saved_labels = () => {
  let saved = [];
  if(localStorage["labels"]) {
    saved = JSON.parse(localStorage["labels"]);
  }
  return saved.filter(l => l.label.name === current_label.name)
}

const load_label = (label) => {
  current_label = label.label;
  render_form()
  current_label.fields.forEach(field => {
    $("#" + field.name).val(label.values[field.name].replace(/<br>/g, "\n"));
  });
  render_preview()
}

const save_label = () => {
  let saved = []
  if(localStorage["labels"]) {
    saved = JSON.parse(localStorage["labels"]);
  }
  const values = field_values()
  const new_label = {
    label: current_label,
    values: values,
    id: values.title + '-' + Date() + '-' + (Math.random() * 10000000000000000)
  }
  saved.push(new_label)
  localStorage["labels"] = JSON.stringify(saved);
  $("#saved-list").append(render_label_for_saved(new_label))
  $("#store h5").show();
}

const delete_label = (id) => {
  const saved = JSON.parse(localStorage["labels"])
  localStorage["labels"] = JSON.stringify(saved.filter(l => l.id !== id))
  render_saved()
}

const show_download_popup = (label) => {
  $("#shade").show()
  $("#label-content").val(JSON.stringify(label))
  $("#download-done").on("click", () => {$("#shade").hide()})
  $("#label-content").select()
  $("#label-content").on("click", () => $("#label-content").select())
}

const render_label_for_saved = (label) => {
  const li = $('<li class="saved-label">')
  li.text(label.values.title)
  const left_group = $(`<div class="btn-group">`)
  const show_btn = $(`<button class="btn btn-sm btn-outline-primary">`)
  show_btn.html(`<i class="far fa-eye"></i>`)
  show_btn.on("click", ev => load_label(label))
  left_group.append(show_btn)
  const ua = window.navigator.userAgent
  const isIE = /*@cc_on!@*/false || !!document.documentMode
  const download_btn = $(`<a class="btn btn-sm btn-outline-primary" target="_blank">`)
  download_btn.html(`<i class="fas fa-download"></i>`)
  if (ua.indexOf("Edge") > -1 || isIE) {
    // Download button won't work
    download_btn.on("click", (e) => {
      e.preventDefault()
      download_btn.attr("href", "#")
      show_download_popup(label)
    })
  } else {
    download_btn.attr("href", "data:text/json;charset=utf-8," + encodeURIComponent(JSON.stringify(label)))
    download_btn.attr("download", label.values.title + ".cml")
  }
  left_group.append(download_btn)
  li.append(left_group)
  const delete_btn = $(`<button class="btn btn-sm btn-outline-danger">`)
  delete_btn.html(`<i class="far fa-trash-alt"></i>`)
  delete_btn.on("click", ev => delete_label(label.id))
  li.append(delete_btn)
  return li
}

const render_saved = () => {
  $("#saved-list").html("")
  const saved = get_saved_labels()
  if (saved.length === 0){
    $("#store h5").hide();
  } else {
    $("#store h5").show();
  }
  saved.forEach((l, i) => {
    $("#saved-list").append(render_label_for_saved(l))
  })
}

const render_form = () => {
  let label = current_label
  $("#label-form").html(
    label.fields
      .filter(f => f.type == "input")
      .map(
        f => `
<div class="form-group" id="fg_${f.name}">
  <label for="${f.name}">${f.label}</label>
  ${f.dropdown? '<select class="form-control dropdown" data-name="' + f.name + '" id="select_"' + f.name + '"></select>' : ''}
  <${f.multiline? 'textarea' : 'input type="text" value="' + f.placeholder + '"'}
    id="${f.name}"
    class="form-control"
  >${f.multiline? f.placeholder + '</textarea>' : ''}
</div>`
      )
  )
  $('.dropdown').each(function() {
    const dropdown = $(this)
    const input = $(this).attr("data-name")
    const db = DATABASE[input]
    const dropdown_html = Object.keys(db).map(k =>
      `<optgroup label="${k}">${Object.keys(db[k]).map(name => `<option value="${k}|${name}">${name}</option>`).reduce((a,b) => a + b, '')}</optgroup>`
    ).reduce((a,b) => a + b, '')
    $(this).html(dropdown_html).on('change', function () {
      const split = dropdown.val().split("|")
      console.log(split)
      const ingredients = db[split[0]][split[1]]
      $('#' + input).val(ingredients)
      render_preview()
    })
  })
  $("#label-form input, #label-form textarea").on("keyup", () => {
    clearTimeout(change_timer)
    change_timer = setTimeout(() => {
      render_preview();
    }, 500);
  })
  render_saved()
};

const render_advanced_controls = () => {
  if (!advanced_controls) {
    $(".advanced-controls").slideUp("fast", function() {$(this).remove()})
    return
  }
  let label = current_label
  label.fields
      .filter(f => f.type == "input")
      .map(f => {
    let colourable = ""
    if (f.colourable) {
      colourable = `Colour: <div class="btn-group">
    <button class="btn btn-sm btn-colour btn-outline-dark">
      <i class="fas fa-circle"></i>
    </button>
    <button class="btn btn-sm btn-colour btn-outline-danger" data-colour="red">
      <i class="fas fa-circle"></i>
    </button>
    <button class="btn btn-sm btn-colour btn-outline-success" data-colour="green">
      <i class="fas fa-circle"></i>
    </button>
    <button class="btn btn-sm btn-colour btn-outline-primary" data-colour="blue">
      <i class="fas fa-circle"></i>
    </button>
  </div>`
    }
    $("#fg_" + f.name).append(`
<div class="advanced-controls" data-name="${f.name}" style="display:none;">
Nudge: <div class="btn-group">
    <button class="btn btn-sm btn-nudge btn-outline-dark">
      <i class="fas fa-arrow-down"></i>
    </button>
    <button class="btn btn-sm btn-nudge btn-outline-dark" data-dir="up">
      <i class="fas fa-arrow-up"></i>
    </button>
  </div>
Text Size: <div class="btn-group">
    <button class="btn btn-sm btn-size btn-outline-dark">
      <i class="fas fa-minus"></i>
    </button>
    <button class="btn btn-sm btn-size btn-outline-dark" data-dir="up">
      <i class="fas fa-plus"></i>
    </button>
  </div>
${colourable}
</div>
`)
  })
  $(".advanced-controls").slideDown("fast")
  $(".btn-nudge").on("click", function() {
    const name = $(this).parent().parent().attr("data-name")
    label.fields.find(f => f.name === name).y += $(this).attr("data-dir") == 'up' ? -0.5 : 0.5
    render_preview()
  })
  $(".btn-size").on("click", function() {
    const name = $(this).parent().parent().attr("data-name")
    label.fields.find(f => f.name === name).font_size += $(this).attr("data-dir") == 'up' ? 0.5 : -0.5
    render_preview()
  })
  $(".btn-colour").on("click", function() {
    const name = $(this).parent().parent().attr("data-name")
    const colour = $(this).attr("data-colour") || "black"
    label.fields.find(f => f.name === name).font_color = colour
    render_preview()
  })
}

const render_preview = () => {
  let label = current_label
  if(label.circular){
    $("#preview").addClass("circular")
  } else {
    $("#preview").removeClass("circular")
  }
  const fields = field_values();
  $("#preview")
    .show()
    .css({
      width: label.width + "mm",
      height: label.height + "mm"
    })
    .html(
      label.fields.map(
        field => `
<div
  id="preview_${field.name}"
  class="field ${field.x ? "" : "centered"}"
  style="top:${field.y}mm; font-size:${field.font_size}pt;
        ${
          field.x ? (field.align === "right" ? "right:" : "left:") + field.x + "mm" : ""
        }; ${
          field.font_weight ? "font-weight:" + field.font_weight : ""
        }; ${
          field.font_color ? "color:" + COLOURS[field.font_color] : ""
        }; ${
          field.align ? "text-align:" + field.align : ""
        }; ${
          field.width ? "width:" + field.width + "mm": ""
        }; ${
          field.font_family ? "font-family:" + field.font_family: ""
        };"
>
  ${field.transform ? TRANSFORMS[field.transform](fields[field.name]) : fields[field.name]}
</div>`
      )
    );
  if (logo_uri) {
    $("#preview").append(`
<div class="logo" style="top:${label.logo.y}mm; left:${(label.width - label.logo.width - (label.logo.x_offset || 0)) / 2}mm;">
<img
  id="logo"
  src="${logo_uri}"
  alt="logo"
  style="width:${label.logo.width}mm; height:${label.logo.width * LOGO_RATIO}mm"
>
</div>`);
  }
  if (label.divider) {
    $("#preview").append(`<div class="divider"></div>`)
  }
  label.fields
    .filter(f => f.type == "input")
    .forEach(field => {
      if (
        Math.floor($("#preview_" + field.name)[0].scrollWidth) >
        Math.ceil($("#preview_" + field.name).innerWidth())
      ) {
        $("#" + field.name).addClass("is-invalid");
        $("#preview_" + field.name).addClass("text-danger");
      } else {
        $("#" + field.name).removeClass("is-invalid");
        $("#preview_" + field.name).removeClass("text-danger");
      }
    });
  if ($(".is-invalid").length) {
    $("#print").attr("disabled", true);
    $("#error")
      .show()
      .text("Some lines of text are too long");
  } else {
    $("#print")
      .attr("disabled", false);
    $("#error").hide();
  }
};

const origins = () => {
  let label = current_label
  const label_origins = [];
  const offset = parseInt($("#input_offset").val())
  const total_count = parseInt($("#input_count").val()) + offset
  let counter = 0
  for (let j = 0; j < label.rows; j++) {
    for (let i = 0; i < label.columns; i++) {
      counter += 1
      if (counter <= offset || counter > total_count) {
        continue
      }
      label_origins.push({
        x: label.origin_x + i * (label.width + (label.margin_x || 0)),
        y: label.origin_y + j * (label.height + (label.margin_y || 0))
      });
    }
  }
  return label_origins;
};

const field_values = () => {
  const fields = {};
  current_label.fields.forEach(field => {
    if (field.type == "fixed") {
      fields[field.name] = field.value;
    } else {
      fields[field.name] = $("#" + field.name).val();
    }
    if (field.multiline) {
      fields[field.name] = fields[field.name].replace(/\n/g, "<br>");
    }
  });
  return fields;
};

const stripHTML = (text) => {
   const tmp = document.createElement("div")
   tmp.innerHTML = text
   return tmp.textContent || tmp.innerText || ""
}

const print = () => {
  if($("#input_count").hasClass("is-invalid")) {
    alert("The offset plus the number of labels you want to print is more than will fit onto one page.")
    return
  }
  let label = current_label
  const doc = new jsPDF({
    orientation: label.orientation || "p"
  })
  doc.setFont("helvetica")
  const fields = field_values();
  origins().forEach(origin => {
    label.fields.forEach(field => {
      doc.setFontSize(field.font_size);
      doc.setFontStyle(field.font_weight || "normal")
      doc.setTextColor(COLOURS[field.font_color] || "#000000")
      if(field.font_family) {
        doc.setFont(field.font_family.replace(" ", "-"))
        doc.setFontType('normal')
      } else {
        doc.setFont("helvetica")
      }
      const x = (field.align === "right") ? label.width - field.x : (field.align === "left" ? field.x : field.x + field.width / 2)
      const value = fields[field.name].replace(/<br>/g, "\n")
      const text = field.transform ? TRANSFORMS[field.transform](value).replace("<br>", "\n") : value

      if (field.is_html) {

        let lines
        if (text.indexOf("\n") >= 0 && !field.force_html) {
          lines = stripHTML(text).split("\n")
        } else{
          lines = doc.splitTextToSize(stripHTML(text), field.width || label.width)
        }
        const line_height = field.font_size * 0.26458333333719  // pixels to mm
        const html_chunks = text.replace(/\n/g, " ").split(" ").filter(c => c)
        let chunk_pointer = 0
        let line_no = 0
        let is_bold = false

        lines.forEach(line => {
          let text_width = 0;
          // calculate chunks
          const chunks = line.split(" ").filter(c => c).map(c => {
            const html_chunk = html_chunks[chunk_pointer]
            chunk_pointer += 1
            const chunk_text = c + " "
            if(html_chunk.startsWith('<b>')){
              is_bold = true
            }
            const ret = {
              text: chunk_text,
              is_bold: is_bold,
              width: doc.getTextWidth(chunk_text),  // pixels to mm
            }
            text_width += ret.width
            if (html_chunk.endsWith('</b>')){
              is_bold = false
            }
            return ret
          })
          // calculate x offset
          let chunk_x = origin.x + (field.x || 0) + ((field.width || label.width) - text_width) / 2;
          // draw line
          chunks.forEach(chunk => {
            if (chunk.is_bold) {
              doc.setFontStyle("bold")
            }
            doc.text(
              chunk.text,
              chunk_x,
              origin.y + field.y + line_no * line_height * 1.4,
              {
                baseline: "top",
                align: "left",
                lineHeightFactor: 1,
              }
            )
            chunk_x += chunk.width
            if (chunk.is_bold) {
              doc.setFontStyle("normal")
            }
          })
          line_no += 1
        })
      } else {
        text.split("\n").forEach((line, idx) => {
          doc.text(
            line,
            field.x ? origin.x + x : origin.x + label.width / 2,
            origin.y + field.y + idx * doc.getFontSize() * doc.getLineHeightFactor() / 2.83465, // points per mm
            {
              baseline: "top",
              align: field.align ? field.align : "center",
              lineHeightFactor: 1,
              maxWidth: field.width || label.width || 0
            }
          )
        })
      }
    });
    if (logo_uri) {
      const file_type = logo_uri.split(";")[0].split("/")[1];
      doc.addImage(
        logo_uri,
        file_type,
        origin.x + (label.width - label.logo.width - (label.logo.x_offset || 0)) / 2,
        origin.y + label.logo.y,
        label.logo.width,
        label.logo.width * LOGO_RATIO
      )
    }

    if(label.divider) {
      doc.setFillColor(41, 96, 51);
      // x, y, width, height
      doc.rect(origin.x + label.width / 2 - 0.25,
               origin.y + label.height * 0.1,
               0.5, label.height* 0.8, 'F');
    }
  })
  doc.save(label.name + ".pdf")
}

