const check_total_counts = () => {
  const offset = parseInt($("#input_offset").val())
  const total_count = parseInt($("#input_count").val())
  if ((offset + total_count) > (current_label.rows * current_label.columns)) {
    $("#input_count").addClass("is-invalid")
    $("#input_offset").addClass("is-invalid")
  } else {
    $("#input_count").removeClass("is-invalid")
    $("#input_offset").removeClass("is-invalid")
  }
}

const authenticate = () => {
  if (btoa(localStorage["password"] || "") === b64) {
    $("#cover").hide();
  } else {
    $("#cover > div").show();
  }
}

$(document).ready(() => {
  authenticate()
  fetch_products()
  $("#back").on("click", () => {
    render_options()
  })
  $("#input_count").on("change", check_total_counts)
  $("#input_offset").on("change", check_total_counts)
  $("head").append(
    `<style>${Object.keys(COLOURS).map(k => {return "." + k + "{color:" + COLOURS[k] + "}"})}</style>`
  )
  Object.keys(labels).forEach(l => {
    $('#labels').append(`
    <button type="button" data_type="${l}" class="label-select btn btn-light btn-lg">
      ${labels[l].name}
    </button>`)
  })
  render_options()
  $(".label-select").on("click", function() {
    current_label = labels[$(this).attr("data_type")]
    render_label_form()
  })
  $("#advanced-controls").on("change", event => {
    advanced_controls = $("#advanced-controls").is(":checked")
    render_advanced_controls()
  })
  $("#save-label").on("click", save_label)
  $("#load-label").on("click", () => {
    document.getElementById('file-upload').click();
  })
  $("#file-upload").on("change", () => {
    const files = $('#file-upload').prop('files');
    if (files.length === 0) {
      return
    }
    const file = files[0]
    const fr = new FileReader()
    fr.onload = function () {
      const label = JSON.parse(fr.result)
      if (label.label.name !== current_label.name) {
        alert("Wrong type of label selected, must be " + label.label.name);
        return
      }
      load_label(label)
    }
    fr.readAsText(file)
  })
  $("#enter-password").on("click", () => {
    const password = $("#password").val().trim() || "";
    if (btoa(password) === b64) {
      localStorage["password"] = password
      authenticate()
    } else {
      $("#password").val("")
      $("#password-error").text("That password was incorrect")
    }
  })
})
